import css from 'styled-jsx/css';

export default css`h2 {
  position: relative;
  font-size: 36px;
  font-family: Source Han Sans CN;
  margin-top: 89px;
  margin-bottom: 20px;
  font-weight: bold;
  color: #333333;
  line-height: 30px;
  text-align: center;
}
h2:after {
  display: block;
  width: 63px;
  height: 3px;
  background-color: #fff;
  content: "";
}
`
